class District {
    
    private static $_data = [];
    
    public static function GetProvinceList($returnAlias = false) {
        $data = self::LoadData(); $list = [];
        foreach($data as $code=>$v) {
            $list[] = ['code' => $code, 'name' => $v->name, 'alias' => $v->alias];
        }
        return $list;
    }
    
    public static function GetCityList($provinceCode, $returnAlias = false) {
        $data = self::LoadData(); $list = [];
        if(isset($data->{$provinceCode})) {
            foreach($data->{$provinceCode}->list as $code=>$v) {
                $list[] = ['code' => $code, 'name' => $v->name, 'alias' => $v->alias];
            }
        }
        return $list;
    }
    
    public static function GetAreaList($provinceCode, $cityCode, $returnAlias = false) {
        $data = self::LoadData(); $list = [];
        if(isset($data->{$provinceCode}) && isset($data->{$provinceCode}->list->{$cityCode})) {
            foreach($data->{$provinceCode}->list->{$cityCode}->list as $code=>$v) {
                $list[] = ['code' => $code, 'name' => $v->name, 'alias' => $v->alias];
            }
        }
        return $list;
    }

